import {makeStyles} from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    palette: {
        type: 'light',
    },
    root: {
        flexGrow: 1,
    },
    directoryComponent: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: 'black',

    },
    paper: {
        padding: theme.spacing(1.75),
        textAlign: 'left',
        backgroundColor: 'white',
        color: 'black',
    },
}));

export default useStyles;
